ProductPageQuery.query:
query ProductPageQuery($id: String!) {
  site {
    siteMetadata {
      title
      description
      titleTemplate
      siteUrl
    }
  }
  product: storeProduct(id: {eq: $id}) {
    id: productId
    slug: linkText
    titleTag
    metaTagDescription
    brand
    linkText
    productName
    description
    categoryTree {
      name
      href
    }
    items {
      ean
      name
      itemId
      images {
        imageUrl
        imageText
      }
      videos {
        videoUrl
      }
      sellers {
        commercialOffer: commertialOffer {
          price: Price
          listPrice: ListPrice
          availableQuantity: AvailableQuantity
          priceValidUntil: PriceValidUntil
          spotPrice
        }
        sellerId
      }
    }
  }
}

