FullTextSearchQuery.query:
query FullTextSearchQuery($from: Int!, $to: Int!, $fullText: String, $selectedFacets: [VTEX_SelectedFacetInput!]!, $sort: String!) {
  vtex {
    productSearch(
      from: $from
      to: $to
      orderBy: $sort
      fullText: $fullText
      selectedFacets: $selectedFacets
      hideUnavailableItems: false
      simulationBehavior: skip
    ) {
      products {
        slug: linkText
        id: productId
        productName
        items {
          itemId
          images {
            imageUrl
            imageText
          }
          sellers {
            sellerId
            commercialOffer: commertialOffer {
              spotPrice
              listPrice: ListPrice
            }
          }
        }
      }
      totalCount: recordsFiltered
    }
    facets(
      fullText: $fullText
      selectedFacets: $selectedFacets
      operator: or
      behavior: "Static"
      removeHiddenFacets: true
    ) {
      facets {
        name
        type
        values {
          key
          name
          value
          selected
          quantity
          range {
            from
            to
          }
        }
      }
    }
  }
}

